items.description_uk:
- Опалення: Пічка газова (Але сонячна сторона і пластикові вікна, тому для опалення витрати газу незначні);
- Меблі на фотографіях відсутні (але в сусідній квартирі знаходиться власна різна мебель, яку можна перемістити за потребою: холодильник, ліжко, шафа, стінка);
- Газова колонка (нова) для підігріву води;
- Пральна машина;
- Тихий (спальний) район;
- Поруч зручна транспортна розв'язка;
- Недалеко від центру міста та медичного університету.
